As expected `SinkOneMulticast` tracks 6 subscribers (3 from the first and 3 from the second set)

<img width="497" alt="SinkOneMulticastAB" src="https://user-images.githubusercontent.com/1471612/162144048-7cc327c6-bc0d-4cd2-bc51-559f9ec86b61.png">

Now dispose of the first set (A1, A2, A3)

```java
// Dispose only the first set
disposablesA.dispose();
```

`doFinally` is invoked for the first set as expected

```
doFinallyA1:cancel
doFinallyA2:cancel
doFinallyA3:cancel
```

but `SinkOneMulticast` won't release those 3 subscribers but continues to hold reference to those

<img width="497" alt="SinkOneMulticastB" src="https://user-images.githubusercontent.com/1471612/162144109-25a18f0a-de02-4fdf-933f-de02f0dd4f84.png">

`SinkOneMulticast` keeps holding those references until the sink emits

```
signalSink.tryEmitValue(true);
```

<img width="530" alt="SinkOneMulticastCleared" src="https://user-images.githubusercontent.com/1471612/162144183-ccd1fdd9-ad3b-4431-8216-49021ff8060b.png">

The above behavior of `SinkOneMulticast` holding references to disposed subscribers blocks its GC collection. This leads to memory leaks in the applications.

The application might have different components listening (subscribed) to the SinkOne. Some of the components may not be interested in the signal at a later point and dispose the subscriptions (for example, in the component close() method). When huge number of such components are created and closed, those subscribers in SinkOne leads to memory leak.', 'reactions': {'url': 'https://api.github.com/repos/reactor/reactor-core/issues/3001/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/reactor/reactor-core/issues/3001/timeline', 'performed_via_github_app': None}}

