My understanding is, the service will include this client-defined identifier in the error response. If that is the case, I wondered if we (SDK) decide how to produce and set the identifier value (rather than allowing the customer to set it to an arbitrary value)

For example, in Java-SDK, each (send|link) link has a unique-Id we generate, and the links are hosted under a connection/container with unique-Id. The SDK logs will include these two identifiers enabling code execution tracing in Cx env. If we could include these unique-Id of link and parent connection in Source and Target (e.g. link_id:connection_id), then it might be easy to correlate the error response from the server with the client-side SDK logs. (Also avoid need to expose it via API).

