My application sends and consumes messages in bursts of arbitrary length. There might be periods of inactivity between messages which may exceed the default connection timeout. In this case the application continues working but I receive error messages.

Code sample and log excerpts below. Full log attached.

My questions:
- Are these errors all expected behaviour and can be safely ignored?
- Is it ok to keep the `ServiceBusSenderAsyncClient` and `ServiceBusProcessorClient` indefinitely, without closing or is there a different preferred way to do it to avoid timeout-related errors? 
- How can the default timeout of 300000 milliseconds be adjusted?

Sample code:
```
public class SenderSample {
  private static final String connectionStringSend = "### connection string to send";
  private static final String connectionStringListen = "### connection string to listen";
  private static final String queueName = "imanage-poc";

  private static final int iterations = 10;

  private ServiceBusSenderAsyncClient sender = initSender();
  private ServiceBusProcessorClient processor = initProcessor();

  private ServiceBusSenderAsyncClient initSender() {
    return new ServiceBusClientBuilder()
        .connectionString(connectionStringSend)
        .sender()
        .queueName(queueName)
        .buildAsyncClient();
  }

  private ServiceBusProcessorClient initProcessor() {
    return new ServiceBusClientBuilder()
        .connectionString(connectionStringListen)
        .processor()
        .queueName(queueName)
        .receiveMode(ServiceBusReceiveMode.PEEK_LOCK)
        .processError(err -> out.printf("%nError occurred: %s%n", err.getException().getMessage()))
        .processMessage(
            ctx -> {
              out.printf("%nConsumed message: %s%n", ctx.getMessage().getBody());
              ctx.complete();
            })
        .buildProcessorClient();
  }

  public static void main(String[] args) throws InterruptedException {
    SenderSample sample = new SenderSample();
    sample.run();
  }

  public void run() throws InterruptedException {
    processor.start();

    for (int i = 1; i <= iterations; i++) {
        sender.sendMessage(new ServiceBusMessage(fromString(format("Msg no. %d", i))))
            .block(Duration.ofSeconds(3));
        TimeUnit.MINUTES.sleep(20);
    }

    processor.close();
  }
}
```

