i.e. replacing `newSubscriberLock` with

```java
private final AtomicBoolean syncSubscribed = new AtomicBoolean(false);
```

then make use of API in AtomicReference to ensure we instantiate subscriber only once + AtomicBoolean to ensure we subscribe only once.

```java
SynchronousMessageSubscriber syncSubscriber = synchronousMessageSubscriber.get();
if (syncSubscriber == null) {
    syncSubscriber.queueWork(work);
    return;
}

syncSubscriber = synchronousMessageSubscriber.updateAndGet(subscriber -> {
    // Ensuring we create SynchronousMessageSubscriber only once.
    if (subscriber == null) {
        return new SynchronousMessageSubscriber(asyncClient,
            work,
            isPrefetchDisabled,
            operationTimeout);
    } else {
        return subscriber;
    }
});

if (!syncSubscribed.getAndSet(true)) {
    // The 'subscribeWith' has side effects hence must not be called from
    // the above updateFunction of AtomicReference::updateAndGet.
    asyncClient.receiveMessagesNoBackPressure().subscribeWith(syncSubscriber);
} else {
    syncSubscriber.queueWork(work);
}
