Upgrade from AI Java Agent from 3.1.1 to 3.2.4. Application is deployed using a docker image and is deployed to Azure Kubernetes Service. The app runs out of memory after a consistent period of time like every 2-3 hours.

***Exception or Stack Trace***
Extracted heap dump and a large percentage of values are coming from netty library. 

![image](https://user-images.githubusercontent.com/12934324/159539570-fe58faf6-2e58-4ad2-ab33-8d18e9fd306f.png)

**To Reproduce**

Steps to reproduce the behavior:

1. Have the below gradle configuration and deploy to AKS

root/build.gradle having below content:

```
plugins {
    id "io.spring.dependency-management" version "1.0.11.RELEASE"
    id "net.linguica.maven-settings" version "0.5"
}

subprojects {

    group = 'com.myapp'
    version = '0.0.1-SNAPSHOT'
    def configDir = "${project.rootDir}/checkstyle"

    apply plugin: 'java'
    apply plugin: 'io.spring.dependency-management'
    apply plugin: 'java-library'
    apply plugin: 'checkstyle'

    repositories {
        mavenCentral()
    }

    ext {
        set('azureVersion', "3.3.0")
    }

    dependencyManagement {
        imports {
            mavenBom "com.azure.spring:azure-spring-boot-bom:${azureVersion}"
        }
    }

    dependencies {
        //lombok
        compileOnly 'org.projectlombok:lombok:1.18.20'
        annotationProcessor 'org.projectlombok:lombok:1.18.20'
        testCompileOnly 'org.projectlombok:lombok:1.18.20'
        testAnnotationProcessor 'org.projectlombok:lombok:1.18.20'

        //Azure key-vault
        implementation 'com.azure.spring:azure-spring-boot-starter-keyvault-secrets'

    }

    checkstyle {
        toolVersion "8.43"
        configFile file("$configDir/checkstyle.xml")
        checkstyleTest.enabled = false
        ignoreFailures = false
        showViolations = true
        maxErrors = 0
        maxWarnings = 0
    }

    checkstyleMain {
        source ='src/main/java'
    }

    checkstyleTest {
    }

    compileJava {
        sourceCompatibility = '11'
        targetCompatibility = '11'
    }

    test {
        useJUnitPlatform()

        testLogging {
            exceptionFormat = 'full'
        }
    }

    configurations {
        copyAI
    }

    task downloadAI(type: Copy) {
        from configurations.copyAI
        into 'build/libs'
    }

}

```
app/build.gradle

```
plugins {
	id 'org.springframework.boot' version '2.4.5'
	id 'jacoco'
}

ext {
	set('azureVersion', "3.3.0")
}

dependencyManagement {
	imports {
		mavenBom "com.azure.spring:azure-spring-boot-bom:${azureVersion}"
	}
}

dependencies {

	developmentOnly 'org.springframework.boot:spring-boot-devtools'
	testImplementation 'org.springframework.boot:spring-boot-starter-test'

	//actuator
	implementation 'org.springframework.boot:spring-boot-starter-actuator'

	//event hub stream binder
	implementation 'com.azure.spring:azure-spring-cloud-stream-binder-eventhubs:2.5.0'

	// App Insights Java Agent (not a project dep--used in the Dockerfile)
	copyAI 'com.microsoft.azure:applicationinsights-agent:3.2.4'

	implementation 'org.springframework.boot:spring-boot-starter-webflux'

	//mapstruct
	implementation 'org.mapstruct:mapstruct:1.4.2.Final'
	annotationProcessor 'org.mapstruct:mapstruct-processor:1.4.2.Final'

	implementation 'com.azure.spring:azure-spring-boot-starter-cosmos:3.3.0'

}

compileJava {
	options.compilerArgs += [
			'-Amapstruct.suppressGeneratorTimestamp=true',
			'-Amapstruct.defaultComponentModel=spring'
	]
}

bootJar {
	archiveFileName = 'app.jar'
}

jacoco {
	toolVersion = "0.8.3"
}

jacocoTestReport {
	reports {
		html.enabled = true
		xml.enabled = true
		csv.enabled = false
	}
}

test {
	useJUnitPlatform()
	finalizedBy jacocoTestReport
}


