Dockerfile:
```
ARG PROJECT_BUILD=app

FROM adoptopenjdk/openjdk11:alpine-slim as builder

ARG BUILD_DATE
ARG VCS_REF
ARG IMAGE_TAG
ARG BASE_INFO
ARG PROJECT_BUILD

ARG ACCESS_TOKEN
ENV AZURE_ARTIFACTS_ENV_ACCESS_TOKEN=${ACCESS_TOKEN}

COPY $PROJECT_BUILD /$PROJECT_BUILD
COPY checkstyle /checkstyle
COPY gradle /gradle
COPY gradlew /gradlew
COPY $PROJECT_BUILD/_settings.gradle /settings.gradle
COPY build.gradle build.gradle
RUN chmod +x ./gradlew
RUN ./gradlew $PROJECT_BUILD:build

# App Insights Agent
RUN ./gradlew $PROJECT_BUILD:downloadAI

FROM adoptopenjdk/openjdk11:alpine-jre
EXPOSE 8080

ARG PROJECT_BUILD
ARG VCS_REF
ENV VERSION_INFO="$VCS_REF;$PROJECT_BUILD"

RUN mkdir /app
RUN mkdir /config

COPY --from=builder ${PROJECT_BUILD}/build/libs/app.jar                        /app/app.jar
COPY --from=builder ${PROJECT_BUILD}/build/libs/applicationinsights-agent*.jar /app/applicationinsights-agent.jar
COPY --from=builder ${PROJECT_BUILD}/config/applicationinsights.json           /app/applicationinsights.json

ENTRYPOINT ["java", "-javaagent:/app/applicationinsights-agent.jar", "-XX:+HeapDumpOnOutOfMemoryError", "-XX:HeapDumpPath=/dumps/oom.bin", "-jar", "/app/app.jar"]
LABEL       org.label-schema.schema-version="1.0" \
            org.label-schema.build-date=$BUILD_DATE \
            org.label-schema.vcs-type="git" \
            org.label-schema.vcs-ref=$VCS_REF \
            org.label-schema.docker.image_tag=$IMAGE_TAG \
            org.label-schema.docker.container_base=$BASE_INFO


```

